var script_f9_14_9441=[" ",
"",
"var calctxt = '';",
"var xmltxt = '';",
"var htmtxt = '';",
"",
"",
"function MyeloDysplasia_fx() {",
"with(document.MyeloDysplasia_form){",
"",
"Score = 0.0;",
"doCalc = true;",
"",
"if (cc1[0].checked){",
"Score = Score + 0;",
"}",
"if (cc1[1].checked){",
"Score = Score + 0.5;",
"}",
"if (cc1[2].checked){",
"Score = Score + 1.5;",
"}",
"if (cc1[3].checked){",
"Score = Score + 2.0;",
"}",
"if (cc2[0].checked){",
"Score = Score + 0;",
"}",
"if (cc2[1].checked){",
"Score = Score + 1.0;",
"}",
"if (cc2[2].checked){",
"Score = Score + 0.5;",
"}",
"if (cc3[0].checked){",
"Score = Score + 0;",
"}",
"if (cc3[1].checked){",
"Score = Score + 0.5;",
"}",
"Score = Math.round(Score * 100) / 100;",
"cctotal.value = Score;",
"",
"if (doCalc){",
"rrclr();",
"if ((Score >= 0) && (Score <= 0)){ document.getElementById('rr1_1').bgColor = '#cccccc';",
"}",
"if ((Score >= 0.5) && (Score <= 1)){ document.getElementById('rr1_2').bgColor = '#cccccc';",
"}",
"if ((Score >= 1.5) && (Score <= 2.0)){ document.getElementById('rr1_3').bgColor = '#cccccc';",
"}",
"if ((Score >= 2.5) && (Score <= 3.5)){ document.getElementById('rr1_4').bgColor = '#cccccc';",
"}",
"",
"}",
"}",
"}",
"",
"",
"",
"",
"function rrclr(){",
"document.getElementById('rr1_1').bgColor = \"\";",
"document.getElementById('rr1_2').bgColor = \"\";",
"document.getElementById('rr1_3').bgColor = \"\";",
"document.getElementById('rr1_4').bgColor = \"\";",
"}",
"",
"",
""].join("\n");
