" <!-- TC:TOPIC_PAGE -->",
" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   m-Cresyl acetate: Drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_patient\" href=\"UTD.htm?29/47/30452?source=see_link\">",
"    see \"m-Cresyl acetate: Patient drug information\"",
"   </a>",
"   )",
"   <br/>",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"UTD.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"list ubnlist drugH1Div drugBrandNames\" id=\"F191412\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Brand Names: U.S.",
"    </span>",
"    <ul>",
"     <li>",
"      Cresylate&trade;",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"ex_sect_xr thclist drugH1Div drugBrandNames\" id=\"F191416\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      Otic Agent, Anti-infective",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block doa drugH1Div\" id=\"F191413\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     <b>",
"      Otitis externa:",
"     </b>",
"     Otic: Instill 3-5 drops into the affected ear(s) 3 times daily (maximum duration: 14 days).",
"     <b>",
"      Note:",
"     </b>",
"     Manufacturer's labeling recommends a dose reduction in children, but does not provide specific dosing recommendations.",
"    </p>",
"   </div>",
"   <div class=\"block dop drugH1Div\" id=\"F191415\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Pediatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Refer to adult dosing. Manufacturer's labeling recommends a dose reduction in children, but does not provide specific dosing recommendations.",
"    </p>",
"   </div>",
"   <div class=\"block doe drugH1Div\" id=\"F191414\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Geriatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Refer to adult dosing.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F191408\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;text-align:justify;display:inline\">",
"     Excipient information presented when available (limited, particularly for generics); consult specific product labeling.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Solution, otic [drops]:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Cresylate&trade;: 25% (15 mL) [contains benzyl alcohol, castor oil, isopropyl alcohol 25%]",
"    </p>",
"   </div>",
"   <div class=\"block geq drugH1Div\" id=\"F191402\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Generic Equivalent Available: U.S.",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     No",
"    </p>",
"   </div>",
"   <div class=\"block adm drugH1Div\" id=\"F14457117\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Administration",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     For otic use only. Patient should lie down with the affected ear upward and instill medication. Patient should remain in this position for at least 1 minute to allow penetration of solution.",
"    </p>",
"   </div>",
"   <div class=\"block use drugH1Div\" id=\"F191409\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Treatment of external otitis infections caused by susceptible bacteria or fungus",
"    </p>",
"   </div>",
"   <div class=\"block ars drugH1Div\" id=\"F14457077\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Adverse Reactions Significant",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Frequency not defined: Otic: Irritation",
"    </p>",
"   </div>",
"   <div class=\"block coi drugH1Div\" id=\"F14457073\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Contraindications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Hypersensitivity to m-cresyl acetate or any component of the formulation; perforated ear drum",
"    </p>",
"   </div>",
"   <div class=\"block war drugH1Div\" id=\"F14457074\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Warnings/Precautions",
"    </span>",
"    <p style=\"text-indent:0em;\">",
"     <b>",
"      <i>",
"       Concerns related to adverse effects:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     &bull; Irritation: If irritation or sensitization occurs, discontinue use.",
"    </p>",
"    <p style=\"text-indent:0em;\">",
"     <b>",
"      <i>",
"       Other warnings/precautions:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     &bull; Appropriate use: For external use only; avoid contact with eyes and hearing-aid plugs. If improvement is not observed after 2 weeks, additional therapy may be needed.",
"    </p>",
"   </div>",
"   <div class=\"block cyt drugH1Div\" id=\"F13299647\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Metabolism/Transport Effects",
