"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 568px\">",
"   <div class=\"ttl\">",
"    Postoperative subcutaneous abscess of the palm",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 548px; height: 371px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A subcutaneous abscess of the fingers or hand is usually the result of minor penetrating trauma that was neglected. Abscesses of the palmar skin are typically localized because the fibrous septae anchoring palmar skin limit the spread of infection. This photograph demonstrates the postoperative appearance after surgical drainage of a subcutaneous abscess of the palm.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
