var title_f9_14_9445="Pancreatic fistula series";
var content_f9_14_9445=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F69452&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F69452&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 522px\">",
"   <div class=\"ttl\">",
"    Pancreatic fistula",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 502px; height: 376px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A 45-year-old man was admitted with acute alcoholic pancreatitis. Computed tomography (CT) scan on day 7 showed necrosis of body and tail of the pancreas (upper left panel). On day 28 he developed high fever. Fine-needle aspiration confirmed the suspicion of infected pancreatic necrosis. This was treated with percutaneous drainage and lavage (upper right panel). A sinogram through the drainage catheter revealed a pancreatic duct leak from the neck of the pancreas with retrograde and antegrade filling of the pancreatic duct (lower left panel). The external pancreatic fistula was successfully treated with endoscopic retrograde cholangiopancreatography (ERCP), dilatation of the stricture in the pancreatic head and stenting of the pancreatic duct (lower right panel).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Dia T Simmons, MD, Santhi Swaroop Vege, MD, and Suresh T Chari, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
