" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Eosinophilic granulomatosis with polyangiitis (Churg-Strauss) lateral chest radiograph",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 237px; height: 289px; background-image: url(data:image/jpeg;base64,);\">",
