var title_f9_14_9452="ISHLT cardiac allograft vasculopathy nomenclature";
var content_f9_14_9452=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F70548&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=11\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F70548&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=11\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ISHLT cardiac allograft vasculopathy nomenclature",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        <strong>",
"         ISHLT CAV0 (Not significant):",
"        </strong>",
"        No detectable angiographic lesion.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         ISHLT CAV1 (Mild):",
"        </strong>",
"        Angiographic left main (LM) &lt;50 percent, or primary vessel with maximum lesion of &lt;70 percent, or any branch stenosis &lt;70 percent (including diffuse narrowing) without allograft dysfunction.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         ISHLT CAV2 (Moderate):",
"        </strong>",
"        Angiographic LM &ge;50 percent*; a single primary vessel &ge;70 percent, or isolated branch stenosis &ge;70 percent in branches of 2 systems, without allograft dysfunction.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         ISHLT CAV3 (Severe):",
"        </strong>",
"        Angiographic LM &ge;50 percent, or two or more primary vessels &ge;70 percent stenosis, or isolated branch stenosis &ge;70 percent in all 3 systems; or ISHLT CAV1 or CAV2 with allograft dysfunction (defined as LVEF &le;45 percent) or evidence of significant restrictive physiology.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) A \"primary vessel\" denotes the proximal and middle 33 percent of the left anterior descending artery, the left circumflex, the ramus and the dominant or co-dominant right coronary artery with the posterior descending and posterolateral branches.",
"    <br>",
"     (B) A \"secondary branch vessel\" includes the distal 33 percent of the primary vessels or any segment within a large septal perforator, diagonals and obtuse marginal branches or any portion of a non-dominant right coronary artery.",
"     <br>",
"      (C) Restrictive cardiac allograft physiology is defined as symptomatic heart failure with echocardiographic E to A velocity ratio &gt;2 (&gt;1.5 in children), shortened isovolumetric relaxation time (&lt;60 msec), shortened deceleration time (&lt;150 msec), or restrictive hemodynamic values (Right Atrial Pressure &gt;12 mmHg, Pulmonary Capillary Wedge Pressure &gt;25 mmHg, Cardiac Index &lt;2 l/min/m",
"      <sup>",
"       2",
"      </sup>",
"      ).",
"      <div class=\"footnotes\">",
"       * Normal graft function.",
"      </div>",
"      <div class=\"reference\">",
"       Reproduced from: Mehra, M, Crespo-Leiro, M, Dipchand, A, et al. International Society for Heart and Lung Transplantation working formulation of a standardized nomenclature for cardiac allograft vasculopathy-2010. J Heart Lung Transplant 2010; 29:717. Illustration used with the permission of Elsevier Inc. All rights reserved.",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
